import React, { Component } from 'react';
import { Card } from 'antd';
import { withCookies } from 'react-cookie';

const { Meta } = Card;

class Report extends Component {
  render() {
    const { report, index } = this.props;
    return (
      <div>
        <Card
          className={`reporting__menu__item animated fadeInUp`}
          style={{ width: '100%', animationDuration: `${0.5 * (index + 1)}s` }}
          cover={
            <img
              alt="example"
              src={report.cover}
            />
          }
        >
          <Meta
            title={report.title}
            description={report.description}
          />
        </Card>
      </div>
    )
  }
}

export default withCookies(Report);
